import Player from "./Player";
import classes from "./Admin.module.css";

export default function StaffList({ staffData }) {
  return (
    <div className={classes.staffList}>
      <button className={classes.addUser}>Добавить пользователя</button>
      {staffData.map((index, staffPlayer) => {
        return <Player key={index} playerData={staffPlayer} />;
      })}
    </div>
  );
}
